const floatingRoot = document.getElementById("floatingRoot");

const bubbleWords = [
  "Discount!", "Best Deal", "ðŸ”¥ Trending",
  "Hot Offer", "50% OFF", "Limited", "New Arrival"
];

let floatInterval = null;

function spawnBubble() {
  let el = document.createElement("div");
  el.className = "popText";
  el.innerText = bubbleWords[Math.floor(Math.random() * bubbleWords.length)];
  el.style.left = Math.random() * 80 + "vw";
  el.style.top = "75vh";
  floatingRoot.appendChild(el);
  setTimeout(() => el.remove(), 4800);
}

function startFloating() {
  if (!floatInterval) floatInterval = setInterval(spawnBubble, 1200);
}

function stopFloating() {
  clearInterval(floatInterval);
  floatInterval = null;
  floatingRoot.innerHTML = "";
}

startFloating();

function go(page) {
  document.querySelectorAll("section").forEach(s => s.classList.remove("active"));
  document.getElementById(page).classList.add("active");

  document.querySelectorAll(".nav a").forEach(a => a.classList.remove("active"));
  let btn = document.getElementById("nav-" + page);
  if (btn) btn.classList.add("active");

  if (page === "landing" || page === "home") startFloating();
  else stopFloating();
}

function startNow() { go("home"); }

