const grid = document.getElementById("productGrid");

function renderProducts(list) {
  grid.innerHTML = "";

  list.forEach((p) => {
    const realIndex = PRODUCTS.indexOf(p);

    grid.innerHTML += `
      <div class="product">
        <img src="${p.image}">
        <h3>${p.name}</h3>
        <p style="color:var(--muted);">${p.description}</p>

        <div class="price-box">
          <strong>â‚¹${p.lowest}</strong>
          <button class="buy-btn" onclick="openBuy(${realIndex})">Buy</button>
        </div>
      </div>
    `;
  });
}


renderProducts(PRODUCTS);
function openCategory(cat) {
  go("products");
  if (cat === "all") renderProducts(PRODUCTS);
  else renderProducts(PRODUCTS.filter(p => p.category === cat));
}
function searchLive() {
  let q = document.getElementById("searchInput").value.toLowerCase();
  filterProducts(q);
}

function searchProducts() {
  let q = document.getElementById("searchInput").value.toLowerCase();
  filterProducts(q);
}

function filterProducts(q) {
  let res = PRODUCTS.filter(p =>
    p.name.toLowerCase().includes(q) ||
    p.category.toLowerCase().includes(q) ||
    p.description.toLowerCase().includes(q) ||
    p.stores.some(s => s.store.toLowerCase().includes(q))
  );
  renderProducts(res);
}
let CURRENT_PRODUCT = null;
let SELECTED_STORE_INDEX = 0;

function openBuy(i) {
  CURRENT_PRODUCT = PRODUCTS[i];
  SELECTED_STORE_INDEX = 0;

  const box = document.getElementById("buyBox");

  box.innerHTML = `
    <h3>${CURRENT_PRODUCT.name}</h3>
    <img src="${CURRENT_PRODUCT.image}" style="width:140px;margin:auto;display:block;border-radius:12px;">

    <h4>Select Store</h4>
    ${CURRENT_PRODUCT.stores.map((s,index)=>`
      <button class="btn btn-primary" style="width:100%;margin-top:8px"
        onclick="SELECTED_STORE_INDEX=${index}">
        ${s.store} â€” â‚¹${s.price}
      </button>
    `).join("")}

    <button class="btn btn-primary" style="width:100%;margin-top:14px" onclick="openPay()">
      Proceed to Pay
    </button>
  `;

  document.getElementById("buyModal").classList.add("active");
}

function closeBuy() {
  document.getElementById("buyModal").classList.remove("active");
}
function openPay() {
  closeBuy();
  document.getElementById("payAmount").innerText =
    CURRENT_PRODUCT.stores[SELECTED_STORE_INDEX].price;

  document.getElementById("payModal").classList.add("active");
}

function closePay() {
  document.getElementById("payModal").classList.remove("active");
}
function submitPayment() {
  let name = document.getElementById("payerName").value.trim();
  let addr = document.getElementById("payerAddress").value.trim();
  let phone = document.getElementById("payerPhone").value.trim();

  if (!name || !addr || phone.length !== 10)
    return alert("Enter valid details.");

  closePay();
  showSuccess(name, addr, phone);
}
function showSuccess(name, addr, phone) {
  document.getElementById("successInfo").innerHTML = `
    <strong>${CURRENT_PRODUCT.name}</strong><br>
    Price: â‚¹${CURRENT_PRODUCT.stores[SELECTED_STORE_INDEX].price}<br><br>
    Delivering to:<br>
    <span style="color:#bcd2ff;">
      ${name}<br>${addr}<br>
      Phone: ${phone}
    </span>
  `;

  document.getElementById("success").classList.add("active");
  runConfetti();
}

function closeSuccess() {
  document.getElementById("success").classList.remove("active");
}
function runConfetti() {
  const root = document.getElementById("confetti");
  root.innerHTML = "";

  const colors = ["#00eaff","#9b4bff","#00ffb3","#ffd166","#ff5ea2"];

  for (let i = 0; i < 45; i++) {
    let c = document.createElement("div");
    c.className = "confetti-piece";
    c.style.left = Math.random() * 100 + "vw";
    c.style.top = "-10vh";
    c.style.background = colors[Math.floor(Math.random() * colors.length)];
    c.style.animationDuration = (3 + Math.random() * 2) + "s";
    root.appendChild(c);
  }
}